衝撃の堅さ！9H　保護ガラス<br>
ｉＰｈｏｎｅ６/６ｓ・ｉＰｈｏｎｅ６/６ｓプラス対応です♪<br>
脅威の透過率で本来の発色状態を維持！<br>
衝撃は強化ガラスに吸収されますので、ディスプレイにかかる衝撃負荷を軽減するのでディスプレイが破損することを防ぎます。<br>


<br>
<br>
<font size="+2"><br>iPhoneケースはこちらから！</font>
<br>
※液晶を完璧に保護するものではございませんので、機種のお取り扱いには十分ご注意ください。なお、機種または液晶画面の破損に関しては当店では責任を負いかねますので何卒ご容赦ください。


